svg.script:


	function SelectEvent(evt,event) {
	// Here the Polygon element is taken reverted to text and the "Poly" text is removed from ID name to ge the EventID
		var HistoryEvtCIRCLE = evt.target.id;
		var lengthIdCIRCLE = HisroryEvtCIRCLE.length;
		var lengthIdEvent = lengthIdCIRCLE - 6;
		var eventId = HistoryEvtCIRCLE.substr (0,lengthIdEvent);
		var HistoryEvtGROUP = this.document.getElementById(eventId);
		var ArrayOfEvents = ["1993GROUP", "2000GROUP", "2005GROUP", "2010GROUP", "2017GROUP"];
		if (event == "mouseover")
		HistoryEvtGROUP.style.opacity = 1;
		for (var i = 0; i < ArrayOfEvents.length ; i++)
    	{
				  var varWileyEvent = this.document.getElementById(ArrayOfEvents[i]);
				  if (varWileyEvent !== vastage)
				  {varWileyEvent.style.opacity = 0.7;}


	    }
	}
    function EventClick(evt)
    {
    	var vastagePoly = evt.target.id;
		var lengthIdPoly = vastagePoly.length;
		var lengthIdText = lengthIdPoly - 4;
		var TextId = vastagePoly.substr (0,lengthIdText);
//		var vastage = this.document.getElementById(TextId);
		var ArrayOfTexts = ["Revenue18blnText", "JohnWileyEpoch1826Text", "FirstRecognition1961Text", "GlobalMarket1895Text", "Revenue1mln1929Text", "Revenue6mln1950Text",
					"OfficeLondon1960Text", "FirstRecognition1961Text", "Revenue100mln1980Text", "JohnWileySons1876Text", "FirstBookShop1814Text", "ScienceFocus1848Text", "Blossom193256Text",
					"OfficeOAE201012Text", "Foundation1807Text", "OfficesJapan1970Text", "OfficesAustral196070Text", "WileyShares1962Text", "NewBusiness1982Text"];
		var vastageText = TextId + "Text";
		var vastage = this.document.getElementById(vastageText);
        vastage.style.visibility = "visible";
		vastage.style.opacity = "1";
		vastage.style.transition = "opacity 1s, visibility 0s";


		for (var i = 0; i < ArrayOfTexts.length ; i++)
    	{
				  var varWileyText = this.document.getElementById(ArrayOfTexts[i]);
				  if (varWileyText !== vastage)
				  {varWileyText.style.visibility = "hidden";
				   varWileyText.style.opacity = 0;
				   vastage.style.transition = "opacity 0.25s visibility 0s 0.25s";
				  }
        }
   }
